import React from 'react';
import Item from '../../Item/Item';
import '../../Item/Item.css'

const cafe_denUrl = `${process.env.PUBLIC_URL}/img/cafe_sua.png`
const bacxiuUrl = `${process.env.PUBLIC_URL}/img/bac_xiu.png`
const cafe_suaUrl = `${process.env.PUBLIC_URL}/img/cafe_sua.png`
const cafeUrl = `${process.env.PUBLIC_URL}/img/cafe_sua.png`



function SuggestBox(props) {
    return (
        <div className='SuggestBox'>
            <Item linkURL={cafe_denUrl} />
            <Item linkURL={cafeUrl} />
            <Item linkURL={cafeUrl} />
            <Item linkURL={cafeUrl} />
            <Item linkURL={cafeUrl} />
        </div>
    );
}

export default SuggestBox;
